import React, { useState } from 'react';

function Projects (props) {
    return (
        <div>
            <img src='./images/weather-dashboard.png' alt="Weather Dashbaord" />
            <h4>{props.name}</h4>
            <h4>{props.url}</h4>
            <h4>{props.repo}</h4>
        </div>
    );
}

export default Projects;
